import React from "react";
import mic from './images/mic-fill.svg';
import micMuted from './images/mic-mute-fill.svg';
import keyboard from './images/keyboard.svg';
import './Practice.css';

function Practice() {
  return (
    <div className="practice-container">
        <div className="input-container">
            <button className="circle-button mic-btn">
                <img className="mic-btn-img" src={mic}/>
            </button>
        </div>
        <div className="input-container">
            <button className="circle-button mic-btn">
                <img className="keyboard-btn-img" src={keyboard}/>
            </button>
        </div>
    </div>
  );
}

export default Practice;
